import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

  export default function AdminRouter() {
    return (
        <div>
            <ul>
                <li>
                    <Link to="/admin/category/search">Search</Link>
                </li>
                <li>
                    <Link to="/admin/category/add">Add New</Link>
                </li>
            </ul>

            <hr />
            <Switch>
                <Route exact path="/admin/category/search">
                    <Home />
                </Route>
                <Route path="/admin/category/add">
                    <About />
                </Route>
            </Switch>
        </div>
    );
}

function Home() {
    return (
        <div>
        <h2>Home</h2>
        </div>
    );
}

function About() {
    return (
        <div>
        <h2>About</h2>
        </div>
    );
}
